    false,nt"url": null,nt"notes": "This Land Protection Plan (LLP) describes
    the priorities for acquiring additional acres within the boundary of the Rainwater
    Basin Wetland Management District. The Service developed this LPP to provide local
    landowners, governmental agencies, and the interested public with a general understanding
    of the anticipated management approaches for the acquisition program. The purpose
    of the LPP is to present a broad overview of the Services's future management approach
    to wildlife and associated habitats, public uses, interagency coordination, public
    outreach, and other operational needs. The Rainwater Basin Expansion Project will
    be implemented in the main portion of the Rainwater Basin Region of south central
    Nebraska. This project expands the Services's acquisition authority from its current
    limit of 24,000 acres to 38,177 acres.",nt"license_title": "License Not Specified",nt"extras":
